import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import PrivateRoute from './utils/PrivateRoute';
import { AuthProvider } from './context/AuthContext';

import Sidebar from './components/Sidebar';

import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import ProjectPage from './pages/ProjectPage';
import ProjectDetailsPage from './pages/ProjectDetailsPage';
import NewProjectPage from './pages/NewProjectPage';
import ClientDetailsPage from './pages/ClientDetailsPage';
import ManagerClientPage from './pages/ManagerClientPage';
import DashboardPage from './pages/DashboardPage';

function App() {
  return (
    <div className="App">
       <div>
        <div className='container-fluid'>
          <div className='row base'>
            <div className='sidebar col-3 mt-2 shadow'>
              <Sidebar/>
            </div>
            <div className="main col mt-5">
              <div className='container-fluid'>
              <Router>
                <AuthProvider>
                  <PrivateRoute component={DashboardPage} path="ui/" exact/>
                  <PrivateRoute component={HomePage} path="ui/home"/>
                  <PrivateRoute component={ProjectPage} path="ui/project"/>
                  <PrivateRoute component={ProjectDetailsPage} path="ui/project-details"/>
                  <PrivateRoute component={NewProjectPage} path="ui/new-project"/>
                  <PrivateRoute component={ManagerClientPage} path="ui/mc"/>
                  <PrivateRoute component={ClientDetailsPage} path="ui/clnt"/>
                  <Route component={LoginPage} path="ui/login"/>
                </AuthProvider>
              </Router>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
